  const navigate = useNavigate()
  return (<>
    {/* <Header/>  */}
    <div class='main-body'>
      <div class='editor-bar'>
        <button class='editor-bar__button' onClick={() => navigate("/create")}>
          create
        </button>
      </div>
      {postArray.map(post => <Post post = {post} referencing = {true} />)}
    </div>
    <div class='dummy'></div>
    {/* <Footer/> */}
  </>)
}

export default MainPage;
